  }

.vlPlayer2009.tealBt .vlcToggleHD:hover>s>i, .vlPlayer2009.tealBt .vlcToggleHD.active>s>i, .vlPlayer2009.tealBt.hd720p .vlcToggleHD>s>i {
    background-position: -481px -26px!important;
}
    .vlPlayer2009.tealBt .vlcExpand:hover > s > i, .vlPlayer2009.tealBt .vlcExpand.active > s > i {
    background-position: -182px -26px;
}
.vlPlayer2009.tealBt.expanded .vlcExpand:hover > s > i, .vlPlayer2009.tealBt.expanded .vlcExpand.active > s > i {
    background-position: -212px -26px;
}
}

